import { StrictMode } from "react";
import ReactDOM from "react-dom";
import App from "./components/App";
import Game from "./components/Game"
import './index.css';
import React, { Component } from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import axios from "axios";

class Renders extends Component {
  state = { routes: {"testRoute":"World", "testRoute2":"Hello"}, requested: false};

  componentDidMount() {
    axios.get("http://localhost:8000/api/links/").then((res) => {this.setState({routes: res.data});console.log(res.data)})
  }
  addRoute = (route, category) => {
    this.setState(
      (previousState) => ({
        routes: {...previousState.routes, ...{[route]:category}}
      }),
      console.log(Object.keys(this.state.routes)))
  };

  render() {
    return (
      <BrowserRouter>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          {Object.keys(this.state.routes).map((path) => (
            <li key={path}>
              <Link to={`/${path}`}>{path}</Link>
            </li>
          ))}
        </ul>
        <Routes>
          <Route path="/" element={<App callBackFunction={this.addRoute}/>} />
          {Object.entries(this.state.routes).map(([routePoint, category]) => (
            <Route
              key={routePoint}
              path={["/", routePoint].join("")}
              element={<Game key={routePoint} point={routePoint} category={category} questions={5} />}
            />
          ))}
        </Routes>
      </BrowserRouter>
    );
  }
}

const rootElement = document.getElementById("root");
ReactDOM.render(
  <StrictMode>
    <Renders />
  </StrictMode>,
  rootElement
);
